let time = 0;
// Function to send a POST request
function sendRequest(item,index) {
    const options = {
        method: 'POST',
        url: 'http://127.0.0.1:8000/fb-page-webhook/'+index,
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify(item) // Using 'item' from the data array as the body
    };

    request(options, function (error, response) {
        if (error) console.log("Error Item is "+ index);
        console.log(response.body,`Message ${index} Operation Success`);
    });
}

